import React from 'react'
import './main.css';
import { Row, Col, Container } from 'react-bootstrap';
import TestBlock from './TestBlock';

const Testimonial = () => {
    return (
        <div className='Test-Module'>
        <Container >
            <p className='heading'>Testimonials</p>
            <Row>
            <TestBlock></TestBlock>
            <TestBlock></TestBlock>
            </Row>
            <Row>
            <TestBlock></TestBlock>
            <TestBlock></TestBlock>
            </Row>
        </Container>
        </div>
    )
}

export default Testimonial;
